import Link from "next/link";
import Nav from "./Nav";
import styled from "styled-components";
export default function Header() {
  return (
    <header>
      <div className="bar">
        <Link href="">
          <h1>Sick fits</h1>
        </Link>
      </div>
      <div className="sub-bar">Search</div>
      <Nav />
    </header>
  );
}
